import { LOAD, CREATE, UPDATE, DELETE, CLEAR } from "../types/index";

const loadChofers = (da) => ({ type: LOAD , payload:data});
const createChofers = (data) => ({ type: CREATE, payload: data });
const updateChoferes = (data) => ({ type: UPDATE, payload: data });
const deleteChoferes = (id) => ({ type: DELETE, payload: id });
const clearchoferes = () => ({ type: CLEAR });

export { loadChofers, createChofers, updateChoferes, deleteChoferes ,clearchoferes };
